import { React } from "react";
import { Route, BrowseRouter as Router } from "react-router-dom";
import { Home } from "../pages";

const Routes = () => {
  return (
    <Router>
      <Route exact path="/" component={Home} />
    </Router>
  );
};

export default Routes;
